import React from 'react';
import styled from 'styled-components';

const BreederDashboard = () => {
    return (
        <DashboardContainer>
            {/* Left Icon Listing */}
            <Section>
                <IconList>
                    {/* Replace with real data later */}
                    <ArtIcon>Art 1</ArtIcon>
                    <ArtIcon>Art 2</ArtIcon>
                    <ArtIcon>Art 3</ArtIcon>
                </IconList>
            </Section>

            {/* Left Breeding Pad */}
            <Section>
                <BreedingPad>
                    <h3>Breeding Pad (Left)</h3>
                    {/* Place for selected art */}
                </BreedingPad>
            </Section>

            {/* Right Breeding Pad */}
            <Section>
                <BreedingPad>
                    <h3>Breeding Pad (Right)</h3>
                    {/* Place for selected art */}
                </BreedingPad>
            </Section>

            {/* Right Icon Listing */}
            <Section>
                <IconList>
                    {/* Replace with real data later */}
                    <ArtIcon>Art A</ArtIcon>
                    <ArtIcon>Art B</ArtIcon>
                    <ArtIcon>Art C</ArtIcon>
                </IconList>
            </Section>
        </DashboardContainer>
    );

};
// Dashboard container that splits the page into four vertical sections
const DashboardContainer = styled.div`
  display: flex;
  height: 100vh; /* Full height of the viewport */
`;

// Each section takes up one fourth of the width
const Section = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 1rem;
  border-left: 1px solid #ccc;

  &:first-child {
    border-left: none;
  }
`;

// Styling for the icon list
const IconList = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1rem; /* Space between icons */
`;

// Individual art icons in the list
const ArtIcon = styled.div`
  width: 80px;
  height: 80px;
  background-color: #eee;
  border: 1px solid #ccc;
  display: flex;
  justify-content: center;
  align-items: center;
  cursor: pointer;
  font-size: 14px;

  &:hover {
    background-color: #ddd;
  }
`;

// Breeding pads for left and right inner sections
const BreedingPad = styled.div`
  width: 90%;
  height: 90%;
  background-color: #fafafa;
  border: 2px dashed #ccc;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  padding: 1rem;
`;

export default BreederDashboard;
